import React from 'react'
import logo from '../assests/login.png'
function Login() {
  return (
    <div className='w-screen min-h-screen'>
        <div className='w-4/12 max-h-full'>
          <img src={logo} className=' max-w-full h-full'/>
        </div>
    </div>
  )
}

export default Login
